import React , { useEffect, useState } from 'react';
import Counter from './components/Counter';


import './App.css';

const App = () => {

  const APP_KEY = "656c98d724799f2308debe601f2c29b3";


  const [counter, setCounter] = useState([]);

  useEffect( () => {
    getCounter();

  },[]);


  const getCounter = async () => {
    const response = await fetch(`http://api.openweathermap.org/data/2.5/weather?q=London,uk&APPID=${APP_KEY}`);
    const data = await response.json();
    setCounter(data);
    console.log(data);

  }



  return (
    <div>
      <h1>Weather-Finder</h1>

      {counter.map(counters => (
        <Counter/>
      ))}


    </div>

  );

};

export default App;
